At 10:25, I figured out what fixed the issue was inheriting from BaseModel instead of PostBase.

I think the reason is because when PostOut inherited from PostBase it expected the object to look like this:

{
        title: "first post",
        content: "my first post",
        published: True,
        Post: { title: "first post again!?", content: "I posted my first post...for a second time??", published: True, ... }
} 

It looks like the response model expected the title, content and publish to be in both the top level of the object and the nested Post object. However, the top level of the object did not return title, content, or publish and that is why we got the error that title, content, or publish were missing from our response object.

